import React from "react";
import { useLocation } from 'react-router-dom';

function Testing() {
    let location = useLocation(); {/* 이 페이지에 전달된 정보를 받겠다는 코드입니다 */}
    const data = location.state.key; {/* 정보가 dictionary 꼴로 전달된다고 생각하시면 편할 듯 합니다. { state : {key: value}} 형태로 data가 전달되기 때문에 알짜배기 데이터 값은 location.state.key에 저장됩니다. */}
    return (
      <div className="Test">
        {data}
      </div>
    );
  }

  export default Testing;
